import React from 'react';
import Nasa from './nasa.gif';
import Metal from './metal.jpg';
import Button from 'react-bootstrap/Button';

export default class DisplayList extends React.Component {
    constructor(props){
        super(props);
    }


    render(){
        return(
            <div class = "card-columns">
                {this.props.list.map((item) => 
                   <div class = "card" style = {{width: "400px"}}>
                    {/* <img class="card-img-top" alt="Card image cap" {
                        ...item.name === "Nasa" ? (
                            src= {Nasa}
                        )
                    }></img> */}
                    <div class="card-body">
                        <h5 class="card-title">{item.name}</h5>
                        <p class="card-text">card text</p>
                     </div>
                     <ul class="list-group list-group-flush">
                        <li class="list-group-item">{item.topic}</li>
                        <li class="list-group-item">{item.year}</li>
                     </ul>
                     <Button onClick={()=> this.onSelectFilterYear("2019")} variant = "outline-primary" >2019</Button>{' '}
                   </div>

                )}

            </div>


        )
    }
}
